import { Container } from '@material-ui/core';
import { FC } from 'react';
import { Header } from '../components/Header';

const Home: FC = () => {
  return (
    <>
      <Header />
      <Container maxWidth="sm">
        <h1>Home</h1>
      </Container>
    </>
  );
};

export default Home;
